    /**
     * Gets the attribute value for the calculated attribute Status.
     * @return the Status
     */
    public String getStatus() {

        String result="";
        if(getBlockAction()!=null){
            resourceBundle = new EngageResourceBundle();
            if("0".equalsIgnoreCase(getBlockAction().toString().trim()) && getCardExpiry() != null && getCardExpiry().getValue().after(new java.util.Date()))
            {
                if (resourceBundle.containsKey("UNBLOCKED_SINGULAR"))
                {
                result= resourceBundle.getObject("UNBLOCKED_SINGULAR").toString().trim() ;
                 }
            }else if("1".equalsIgnoreCase(getBlockAction().toString().trim()) && getCardExpiry() != null  && getCardExpiry().getValue().after(new java.util.Date()))
            {
                if (resourceBundle.containsKey("TEMPORARY_BLOCKED"))
                {
               result=resourceBundle.getObject("TEMPORARY_BLOCKED").toString().trim() ;
                }
            }else
            {
                if("2".equalsIgnoreCase(getBlockAction().toString().trim()) || (getCardExpiry() != null && getCardExpiry().getValue().before(new java.util.Date())))
                 {
                     if (resourceBundle.containsKey("PERMANENT_BLOCKED"))
                    {
                    result=resourceBundle.getObject("PERMANENT_BLOCKED").toString().trim() ;
                     }
                }
            }
        }
               return result;
//        return (String) getAttributeInternal(STATUS);
    }

